Explainer: So Cantor's diagonal argument can be abstracted and then generalized to prove that for an arbitrary set A, its power set has a strictly larger cardinality. And since that's true for any set, we can just iterate this process. When set theory was being discovered or invented or created in the late 19th century, one of the natural question to ask is can there be a universe of all sets? This comes up in my research in category theory because even though there is no set of all sets, we would really like for there to be a category of sets. So what category theorists need to do to make their work rigorous is to add additional axioms to set theory. One of my favorites was introduced by an algebraic geometer Alexander Grothendieck. This is something that we sometimes call a Grothendieck universe, or also an inaccessible cardinal. It's an infinite number that is so big that it cannot be accessed by any of the other constructions within set theory. It's so big that we'll never get to it and this allows us to contemplate the collection of all sets whose cardinality is bounded by this size that will never reach.
